import React from "react";
import Card from "react-bootstrap/Card";


export default function Cards(props) {
    const {movie} = props;

    return (
        <div className="cards">
            <article className="card">
                <header>
                    <h2>{movie.Title}, {movie.Year}</h2>
                </header>
            <img src={movie.Poster} alt={movie.Title}></img>
            <div className="content">
                <p>{movie.Rated} {movie.Runtime}</p>
            </div>
            </article>


            {/* <figure className="image is-48x48">
                <img src={movie.Poster} alt={movie.Title} />
                <h3>
                    {movie.Title}, {movie.Year} <br/>
                    {movie.Rated} {movie.Runtime}
                </h3>
                <p>Director: {movie.Director} Actors: {movie.Actors}</p>

            </figure> */}

            <Card className="item" style={{ width: '18rem' }}>
                <Card.img>{movie.Poster}</Card.img>
                <Card.Title id="title">{movie.Title}</Card.Title>
                <Card.Body id="body" >Year: {movie.Year}</Card.Body>
            </Card>
        </div>
    );
}
